import { Checkbox, TextField } from "@mui/material";
import React from "react";
import styled from "styled-components";

const NotificationTabView = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
`;

const SelectView = styled.div``;

const NotificationTab = () => {
  return (
    <NotificationTabView>
      <TextField fullWidth variant="standard" label={"Komu Channel Id"} />
      <SelectView>
        <Checkbox
          sx={{
            "&.Mui-checked": {
              color: "#f24b50",
            },
          }}
          style={{ paddingLeft: 0 }}
        />
        <b style={{ color: "#f24b50" }}>Submit timesheet</b>
      </SelectView>
      <SelectView>
        <Checkbox
          sx={{
            "&.Mui-checked": {
              color: "#f24b50",
            },
          }}
          style={{ paddingLeft: 0 }}
        />
        <strong>Gửi thông báo đến Komu</strong>
      </SelectView>
    </NotificationTabView>
  );
};

export default NotificationTab;
